import './index.css'
import {Component} from 'react'

class Feedback extends Component {
  Emojis = emojiObject => {
    return (
      <li>
        <img src={emojiObject.imageUrl} alt={emojiObject.name} />
        <p>{emojiObject.name}</p>
      </li>
    )
  }

  render() {
    const {resources} = this.prop

    return (
      <div>
        <div>
          <h1>How satisfied are you with our customer support perfomance?</h1>
          <div></div>
        </div>
      </div>
    )
  }
}

export default Feedback
